m(71,"ul"),m(72,"li"),g(73," Composition of music for rhythm game levels, level design for rhythm game and programmer for rhythm game "),p(),m(74,"li"),g(75,"Programmer for user interface and menus"),p(),p(),b(76,"br"),b(77,"br"),m(78,"h2",19),g(79,"Development Process"),p(),b(80,"br"),m(81,"p"),g(82,"The game was developed in three iterative stages, or milestones."),p(),b(83,"br"),m(84,"h3",20),g(85,"Milestone 1"),p(),b(86,"br"),m(87,"p"),g(88,"Milestone 1 featured:"),p(),m(89,"ul"),m(90,"li"),g(91," One rhythm game level with the scoring and combo systems implemented. "),p(),p(),b(92,"br"),m(93,"p"),g(94,"View the showcase video below:"),p(),m(95,"video",21),b(96,"source",22),p(),b(97,"br"),b(98,"br"),m(99,"h3",23),g(100,"Milestone 2"),p(),b(101,"br"),m(102,"p"),g(103,"Milestone 2 featured:"),p(),m(104,"ul"),m(105,"li"),g(106," A main menu that allowed the user to choose between Story Mode (the main game mode, consisting of alternating visual novel and rhythm game segments) and Arcade Mode (a 'bite-sized mode' allowing the player to play already cleared levels), or quit the game. "),p(),m(107,"li"),g(108," A Story Mode with a visual novel prologue, and one rhythm game level. "),p(),m(109,"li"),g(110," An Arcade Mode with five rhythm game levels for the user to choose from. "),p(),m(111,"li"),g(112,"Results screens upon the conclusion of each rhythm game level."),p(),p(),b(113,"br"),m(114,"p"),g(115," Feedback was obtained from one test player and the criticism was as follows: "),p(),m(116,"ul"),m(117,"li"),g(118," Inputs for the rhythm game were occasionally unresponsive. This was later discovered to be an error in the code for the beatmap component, and was amended in the next milestone. "),p(),m(119,"li"),g(120," The camera angle and perspective of the rhythm game segment may have made it difficult for the user to see where the falling notes overlapped with the buttons. We solved this issue with a design overhaul of the level layout in the next milestone. "),p()